import axios from "axios";

const proxyUrl = "https://cors-anywhere.herokuapp.com/";

const fetchNftArt = async (url) => {
  const response = await axios.get(`${proxyUrl}${url}`);
  const metadata = response.data;

  return metadata;
};

export default fetchNftArt;
